import React, { Component } from 'react'
import './index.css'
import pictures from '../../pictures/下载.png'
export default class Thirty extends Component {
    render() {
        // console.log('About组件收到的props是',this.props);
        return (
            <div className="thirtyMain" >
                {/* 重点研发30个app */}
                <div className="differDomain">
                    <div className="differApp1">
                        <div className="top1">
                            <span><img src={pictures} alt="图片url失效" style={{ width: "15px", height: "15px" }}></img></span>&nbsp;
                            <span>优化控制域</span>
                        </div>
                        <div className="buttom1" >
                            {/* <div className="YH1"> <span><img src={pictures} alt="图片url失效" className="img"></img></span>&nbsp;</div> */}
                            <div className="YH2"></div>
                            <div className="YH3"></div>
                            <div className="YH4"></div>
                            <div className="YH5"></div>
                        </div>
                    </div>
                    <div className="jianju"></div>
                    <div className="differApp2">生产管控域</div>
                    <div className="jianju"></div>
                    <div className="differApp3">设备运维域</div>
                    <div className="jianju"></div>
                    <div className="differApp4">安全环保域</div>
                    <div className="jianju"></div>
                    <div className="differApp5">能源管控域</div>
                </div>
            </div>
        )
    }
}
